import { Link } from "react-router-dom";

const BlogList = ({ vibes, title}) => {

    return (
        <div className="vibe-list">
            <h2>{ title }</h2>
            {vibes.map((vibe) => (
                <div className="vibe-preview" key={vibe.id}>
                    <Link to={`/vibes/${vibe.id}`}>
                        <h2>{ vibe.title }</h2>
                        {/* <p> Written by { blog.author }</p> */}
                    </Link>
                </div>
            ))}
        </div>
    );
}

export default BlogList;
